// Machine generated by python config_crunch.py
`timescale 1ns / 1ns

module config_romx(
	input [4:0] address,
	output reg [7:0] data
);

always @(address) case(address)
	5'h00: data = 8'h55; // magic
	5'h01: data = 8'h00; // dsp flavor
	5'h02: data = 8'h12; // year
	5'h03: data = 8'h0a; // month
	5'h04: data = 8'h19; // day
	5'h05: data = 8'h07; // hour
	5'h06: data = 8'h13; // minute
	5'h07: data = 8'h00; // code is (dirty), () commits after the latest tag
	5'h08: data = 8'h00; // tool rev (0)
	5'h09: data = 8'h01; // user (larry)
	5'h0a: data = 8'h00; // board type (--TOOL)
	5'h0b: data = 8'h00; // version number
	5'h0c: data = 8'hff; // start of git commit SHA1
	5'h0d: data = 8'hff; // ...
	5'h0e: data = 8'hff; // ...
	5'h0f: data = 8'hff; // ...
	5'h10: data = 8'hff; // ...
	5'h11: data = 8'hff; // ...
	5'h12: data = 8'hff; // ...
	5'h13: data = 8'hff; // ...
	5'h14: data = 8'hff; // ...
	5'h15: data = 8'hff; // ...
	5'h16: data = 8'hff; // ...
	5'h17: data = 8'hff; // ...
	5'h18: data = 8'hff; // ...
	5'h19: data = 8'hff; // ...
	5'h1a: data = 8'hff; // ...
	5'h1b: data = 8'hff; // ...
	5'h1c: data = 8'hff; // ...
	5'h1d: data = 8'hff; // ...
	5'h1e: data = 8'hff; // ...
	5'h1f: data = 8'hff; // end of git commit SHA1
endcase

endmodule
